struct Magic
{
	uint64_t magic;
	uint64_t mask;
	const uint64_t* attacks;
	uint32_t shift;

	constexpr uint64_t operator[](uint64_t occupied) const 
	{ 
		return attacks[(occupied & mask) * magic >> shift]; 
	}
};

